import React, {Component} from 'react';
import "./css/index.scss"

class Banner extends Component {
    state = {
        data:""
    };
    componentDidMount() {
        fetch("http://47.100.98.54:9020/api/banner").then()
    }
    render() {
        return (
            <div className="banner">
                banner
            </div>
        );
    }
}

export default Banner;
